export function add06(a: number, b: number): number {
  return a + b;
}

export function subtract06(a: number, b: number): number {
  return a - b;
}

export function multiply06(a: number, b: number): number {
  return a * b;
}

export function divide06(a: number, b: number): number {
  return a / b;
}
